@Component({
  selector: 'app-logo-mediano',
  templateUrl: './logo-mediano.component.html',
  styleUrls: ['./logo-mediano.component.css']
})
export class LogoMedianoComponent {

}
<a [routerLink]="['/home']">
  <img src="../../../assets/imagenes/Logo2.png" alt="" class="w-3/12 m-auto mt-20">
</a>
